import React from 'react';
import './App.css';
import {createMuiTheme,ThemeProvider,CssBaseline,Divider} from '@material-ui/core'

import BodyArea from './Layout/BodyArea';
import Header from './Layout/Header'
import Footer from './Layout/Footer'
import LoginSignupDialog from  './Dialogs/LoginSignupDialog'

const theme = createMuiTheme({
  palette:{
    type:'dark'
  },
  typography: {
    button: {
      textTransform: 'none'
    }
  }
});

const App = () => (
  <div className="App">
    <ThemeProvider theme={theme}>
    <CssBaseline />
    <Header/>
    <Divider />
    <BodyArea/>    
    <Footer/>
    </ThemeProvider> 
    <LoginSignupDialog isActive={false}/>         
  </div>
);

export default App;
